import React from 'react';
import Navbar from './components/Navbar';
import InterpolPage from './components/InterpolPage'; 
import FbiPage from './components/FbiPage';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';
import PrivateRoute from './routes/PrivateRoute';

const App = () => {
  return (
    <Router>
      <>
        <Navbar />
        <div className="row mt-3">
          <div className="col" id="wanted-persons">
            <Routes>
              <Route path="/fbi" element={<PrivateRoute element={<FbiPage/>} />} />
              <Route path="/interpol" element={<PrivateRoute element={<InterpolPage/>} />} />
              <Route path="/" element={<HomePage/>} />
            </Routes>
          </div>
        </div>
      </>
    </Router>
  );
};

export default App;
